import React from 'react';
import './Note.css'
class Note extends React.Component {
    state={
        item:[],
        currentItem:{
            text:'',
            key:''
        }
    }
    render(){
        return(
            <div className="form">
                <header>
                    <form id="to-do-form">
                        <input 
                            type="text" 
                            placeholder="Enter Text" 
                            value={this.state.currentItem}
                            onChange={this.handleInput}
                        />
                        <button type="submit">Add</button>
                    </form>
                </header>
            </div>

        )
    }
}

export default Note
